import './Map.css';
import { MapContainer, TileLayer, useMap } from 'react-leaflet'
import MarkerPoint from './MarkerPoint.js'
import { useEffect, useState } from 'react';

function Map() {

  const [markers, setMarkers] = useState([])

  const markers2 = [{"lat" : 64.8447463190637, "lng" : -20.643310546875004}, { "lat" : 63.90431409340969, "lng" : -22.17041015625}]

  useEffect(() => {
    fetch("http://localhost:3001/api/v1/points")
    .then(res => res.json())
    .then((res) => setMarkers(res))
  }, [])

  const markersComponents = markers.map((marker) => {
    return <MarkerPoint id={marker.id} lat={marker.lat} lng={marker.lng} date={marker.date} notes={marker.notes} />
  })


  return (
    <MapContainer center={[64.89, -18.58]} zoom={7} scrollWheelZoom={true} id="map">
        <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/copyright">OpenStreetMap</a> contributors'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
        />


        {markersComponents}
    </MapContainer>
  );
}

export default Map;
